Let's create a <button> as a child of the <body> element and set its text : fun main() { Kweb(port = 16097) { doc.body { button().text("Click Me!") } }
} The Kweb DSL can be used to create nested elements: Kweb(port = 16097) { doc.body { table { tr { th().text("Name") th().text("Age") } tr { td().text("Alice") td().text("21") } tr { td().text("Bob") td().text("22") } } }
}

17.body:
The DSL syntax makes it very easy to create elements and their children together: ul { li().text("One") li().text("Two")
} The created Element is passed to the {block} as a parameter, which can be used to set attributes on the element, add listeners, or set the element's text or innerHtml : button { btnEl -> with(btnEl) { classes("bigbutton") this["autofocus"] = true text("Click Me!") }
} We can also use the new {} function to add children to a pre-existing Element: val unorderedList : ULElement = ul()
unorderedList.new { li().text("One") li().text("Two")
}

