If you check the type of counterDoubled , you'll notice that it's a KVal rather than a KVar , meaning it cannot be modified directly, only by changing the KVar it was mapped from. So this will result in a compilation error: val counter = KVar(0)
val counterDoubled = counter.map { it * 2 }
counterDoubled.value = 20 // <--- This won't compile The KVar class has a second map() function which takes a ReversibleFunction implementation. This version of map will produce a KVar which can be modified, as follows: val counterDoubled = counter.map(object : ReversibleFunction<Int, Int>("doubledCounter") { override fun invoke(from: Int) = from * 2 override fun reverse(original: Int, change: Int) = change / 2
})
counter.value = 5
println("counter: ${counter.value}, doubled: ${counterDoubled.value}")
// output: counter: 5, doubled: 10 counterDoubled.value = 12 // <-- Couldn't do this with a KVal
println("counter: ${counter.value}, doubled: ${counterDoubled.value}")
// output: counter: 6, doubled: 12 If the mapped Kvar is changed the original KVar it was mapped from will also change. Reversible mappings are an advanced feature that you only need if you want the mapped value to be a mutable KVar. Most of the time the simple KVal.map {} function is what you need.

37.body:
import kweb.Kweb
import kweb.dom.element.new
import kweb.dom.element.creation.tags.h1
import kweb.routing.route fun main() { Kweb(port = 16097) { doc.body { route { path("/users/{userId}") { params -> val userId = params.getValue("userId") h1().text(userId.map { "User id: $it" }) } path("/lists/{listId}") { params -> val listId = params.getValue("listId") h1().text(listId.map { "List id: $it" }) } } } }
} Now, if you visit http://localhost:16097/users/997 , you will see: User id: 997 The value of these parameters can then be retrieved from the params map, but note that the values are wrapped in a KVar<String> object. This means that you can use all of Kweb's state management features to render parts of the DOM using this value. The key advantage here is that if the URL changes the page can be updated without a full page refresh, but rather only changing the parts of the DOM that need to change - this is much faster and more efficient.

39.body:
You can obtain and modify the URL of the current page using WebBrowser.url . This returns a KVar<String> which contains the URL relative to the origin - so for the page http://foo/bar/z the url would be /bar/z. This KVar will update accordingly if the URL changes, and can also be modified itself, which will change the URL. Here is a more realistic example which demonstrates this: import kweb.Kweb
import kweb.dom.element.creation.tags.a
import kweb.dom.element.new
import kweb.routing.route
import kweb.state.* fun main() { Kweb(port = 16097) { doc.body { route { path("/") { url.value = "/number/1" } path("/number/{num}") { params -> val num = params.getValue("num").toInt() a().text(num.map {"Number $it"}).on.click { num.value++ } } } } }
} If you visit http://localhost:16097/ the URL will immediately update to http://localhost:16097/number/1 without a page refresh, and you'll see a hyperlink with text Number 1. If you click on this link you'll see that the number increments (both in the URL and in the link text), also without a page refresh. num.value++ is worthy of additional attention. num is a KVar<Int> converted from the KVar<String> supplied as a parameter. Because of this it can be incremented via its value property. This change will propagate back causing the URL to update, which will in-turn cause the DOM to update to reflect the new URL. All of this is handled for you automatically.

