Kweb has out-of-the-box support for the excellent Fomantic UI framework, which helps create beautiful, responsive layouts using human-friendly HTML. Getting started First tell Kweb to use the Fomantic UI plugin: import kweb.*
import kweb.plugins.fomanticUI.* fun main() { Kweb(port = 16097, plugins = listOf(fomanticUIPlugin)) { // ... }
} Now the plugin will add the Fomantic CSS and JavaScript code to your website automatically. Let's look at one of the simple examples from the Fomantic UI documentation: <div class="ui icon input"> <input type="text" placeholder="Search..."> <i class="search icon"></i>
</div> This translates to the Kotlin: Kweb(port = 16097, plugins = listOf(fomanticUIPlugin)) { doc.body { div(fomantic.ui.icon.input) { input(type = InputType.text, placeholder = "Search...") i(fomantic.search.icon) } }
} Take a look at the Fomantic UI documentation to see everything else it can do. Example and Demo freenet.org A Kweb website built on Google Cloud Platform with Fomantic styling.

