We rely on a small amount of syntactic sugar defined in kweb.components.Component : typealias Component = ElementCreator<*> And then we can use an extension function on this to create a component: fun Component.simple( prompt: String = "Enter Your Name", name: KVar<String>
) { div { h1().text(prompt) input(type = text).value = name } div { span().text(name.map { "Hello, $it" }) }
} And we use the component like this: Kweb(port = 16097) { doc.body { simple(name = kvar("World")) } } Components are configured through the extension function parameters, typically through a mixture of: Parameter Type For KVal s Values that can change but not be modified by the component KVar s Values that can change or be modified by the component ObservableList s Lists of values that can change or be modified by the component Double, String, etc Values that don't change The simplest Component's may have no parameters at all, or just one or two, while the most complex might use a DSL builder .

